class : public Operation {
  bool match(
    Value *V, std::vector<Match> &Matches) const override {
    
    Value *tmp0;
    bool Matched = hasBitWidth(V, 64) &&
PatternMatch::match(V, m_ZExt(
      m_Value(tmp0))) &&
hasBitWidth(tmp0, 8);
    if (Matched)
      Matches.push_back({
      false,
      // matched live ins
      { tmp0 },
      // the matched value itself
      V
      });
    return Matched;
    
  }
} Operation0;
  

